import React from 'react';
import { withFullpage, FullpageLink } from '../slider/fullpage';
import ReactLogo from '../react-logo/react-logo';
import './nav.css';

const Nav = withFullpage(({ fullpage }) => {
  const { slug } = fullpage.navigation;

  return (
    <header className="page-header">
      <div className="page-header__title">
        <ReactLogo />
        <div>
          <h1>
            <span>REACT</span>
            <span>AWESOME SLIDER</span>
          </h1>
          <h2>FULL-PAGE TRANSITION STRATEGY</h2>
        </div>
      </div>
      <nav>
        <FullpageLink className={slug === '' ? 'selected' : null} href="/">
          index
        </FullpageLink>
        <FullpageLink
          className={slug === 'page-two' ? 'selected' : null}
          href="/page-two"
        >
          page-two
        </FullpageLink>
        <FullpageLink
          className={slug === 'page-three' ? 'selected' : null}
          href="/page-three"
        >
          page-three
        </FullpageLink>
      </nav>
    </header>
  );
});

export default Nav;
